import React from 'react';
import { Form, FormGroup, Label, Input, Button } from 'reactstrap';
import '../../styles/login/index.css';


export default function Login() {
    return (
        <div className = "login card shadow text-center">
            <Form className = "form-signin text-center" style = {{padding:'50px'}}>
                <h1 class = "h3 mb-3 font-weight-normal">ÁreaRestrita</h1>

       
                    <FormGroup>
                <Label for="exampleEmail ">Email</Label>
                <Input type="email" name="email" id="email" placeholder="Email do usuário" />
                    </FormGroup> 

                            <FormGroup>
                <Label for="examplePassword">Senha</Label>
                <Input type="text" name="text" id="text" placeholder="Senha" />
                            </FormGroup>

                            <Button color="primary">Acessar</Button>
                            </Form>
        </div>
    )
}
